import React from 'react';
import Footer from './Footer';
import Map from './Map';

function App() {
  return (
      <div style={{backgroundImage: './nasa.jpg'}}>
           <React.Fragment>
                <Map/>
                <Footer/>
           </React.Fragment>
      </div>
  );
}

export default App;
